import { View, Text, Image, ScrollView, TouchableOpacity } from 'react-native';

export default function Detail({ navigation }) {

  navigation.setOptions({
    headerTitle: 'José'
  })

 return (
   <View>
    <Image
      source={require('../assets/pedreiros.jpg')}
    />
   </View>
  );
}
